class Solution(object):
    def checkStrings(self, s1, s2):
        """
        :type s1: str
        :type s2: str
        :rtype: bool
        """
        if len(s1) != len(s2):
            return False

        odd_chars_s1, even_chars_s1 = {}, {}
        odd_chars_s2, even_chars_s2 = {}, {}

        for i in range(len(s1)):
            if i % 2 == 0:
                even_chars_s1[s1[i]] = even_chars_s1.get(s1[i], 0) + 1
                even_chars_s2[s2[i]] = even_chars_s2.get(s2[i], 0) + 1
            else:
                odd_chars_s1[s1[i]] = odd_chars_s1.get(s1[i], 0) + 1
                odd_chars_s2[s2[i]] = odd_chars_s2.get(s2[i], 0) + 1

        return even_chars_s1 == even_chars_s2 and odd_chars_s1 == odd_chars_s2
